<script>
  function filtrarCamadas() {
    const cddSelecionado = document.getElementById("selectCDD").value;
    const camadaSelecionada = document.getElementById("selectCamada").value;
    const inplantSelecionado = document.getElementById("selectInplant").value.toLowerCase();

    document.querySelectorAll('.leaflet-control-layers-overlays input').forEach(input => {
      const label = input.nextSibling.textContent.trim().toLowerCase();
      const visivelCDD = cddSelecionado === "" || label.includes(cddSelecionado.toLowerCase());
      const visivelCamada = camadaSelecionada === "" || label.includes(camadaSelecionada.toLowerCase());
      const visivelInplant = inplantSelecionado === "" || label.includes(inplantSelecionado);

      const deveMostrar = visivelCDD && visivelCamada && visivelInplant;
      if (input.checked !== deveMostrar) {
        input.checked = deveMostrar;
        input.dispatchEvent(new Event('click'));
      }
    });
  }

  // Preenche automaticamente os Inplants √∫nicos no select
  function preencherInplants() {
    const inplants = new Set();
    document.querySelectorAll('.leaflet-control-layers-overlays label').forEach(label => {
      const texto = label.innerText;
      const match = texto.match(/Inplant: ([^<\n]+)/i);
      if (match && match[1]) {
        inplants.add(match[1].trim());
      }
    });

    const select = document.getElementById("selectInplant");
    inplants.forEach(inplant => {
      const option = document.createElement("option");
      option.value = inplant;
      option.textContent = inplant;
      select.appendChild(option);
    });
  }

  setTimeout(preencherInplants, 2000);
</script>
</body>
